import "./photography.css";
import { motion } from "framer-motion";
import ImageList from "./imagelist/ImageList";
const Photography = () => {
  return (
    <motion.div
      className="photo-page"
      intial={{ opacity: 0 }}
      animate={{ opacity: 1 }}
      exit={{ opacity: 0 }}
    >
      {/* <ImageList /> */}
    </motion.div>
  );
};
export default Photography;
